export default function PostCard({ task }) {
  //prop er post, kunne kaldes alt mulig. skal matche med det data der hentes fra firebase.
  return (
    <>
      {task.image && (
        <article>
          <h2>{task.title}</h2>
          <p>{task.body}</p>
        </article>
      )}
    </>
  );
}
